import React from 'react';
import { createRoot } from 'react-dom/client'; // Import createRoot
import App from './App';

// Create a root instance
const root = createRoot(document.getElementById('root'));

// Render your app
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
